const url =
  "data:image/jpg;base64,";

// console.image(url, 50);

function getStyles(width, height) {
  return (
    "font-size: 0px; padding: " +
    Math.floor(height / 4) +
    "px " +
    Math.floor(width / 2) +
    "px; line-height: " +
    height / 2 +
    "px;"
  );
}
console.image = (url) => {
  let scaler = 0.5;
  // only making an image element to get the dimensions
  let img = new Image();
  img.src = url;
  img.onload = function () {
    const styles = getStyles(this.width * scaler, this.height * scaler);

    const style =
      styles +
      "background: url(" +
      url +
      "); background-size: " +
      this.width * scaler +
      "px " +
      this.height * scaler +
      "px; color: transparent;";
      console.clear()
    console.log("%c+", style);

    console.log("%chello there", "font-size:65px;");
  };
};



console.image(url);

